import {BEGIN_GET_USERDATA, 
    GET_USERDATA_OK, 
    GET_USERDATA_ERROR,
    COMIENZA_LOGIN,
    LOGIN_EXITOSO,
    LOGIN_ERROR,
    MOSTRAR_ERROR, 
    OCULTAR_ERROR
} from '../types/index';

const inisialState = {

    error: null,
    datosusuario: null,
    loading: false,
    mensaje: null
}

export default (state = inisialState, action) =>{

    switch(action.type){

        default: return state;
    }
}
